import React from 'react';
import {
  Rectangle,
  RectangleCenterline,
  FourDotsRect,
  RectangleLabel,
  Ellipse,
  Circle,
  Polygon,
  PolygonLabel,
  PolygonFormula,
  Line,
  Dot,
  Cuboid,
  LShape,
  Grid,
  Recognition,
  Arrow,
  TwoSides,
} from '../../../common/icons';
import { Tool } from '../../types';

interface ToolIconProps {
  tool: Tool;
}

const ToolIcon = ({ tool }: ToolIconProps) => {
  switch (tool) {
    case Tool.RECTANGLE:
      return <Rectangle />;
    case Tool.FOUR_DOTS_RECTANGLE:
      return <FourDotsRect />;
    case Tool.CENTERLINE_RECTANGLE:
      return <RectangleCenterline />;
    case Tool.ELLIPSE:
      return <Ellipse />;
    case Tool.CIRCLE:
      return <Circle />;
    case Tool.POLYGON:
      return <Polygon />;
    case Tool.CUBOID:
      return <Cuboid />;
    case Tool.LSHAPE:
      return <LShape />;
    case Tool.OCR:
      return <RectangleLabel />;
    case Tool.OCR_POLYGON:
      return <PolygonLabel />;
    case Tool.LINE:
      return <Line />;
    case Tool.DOT:
      return <Dot />;
    case Tool.GRID:
      return <Grid />;
    case Tool.RECOGNITION:
      return <Recognition />;
    case Tool.ARROW:
      return <Arrow />;
    case Tool.TWO_SIDES_CUBOID:
      return <TwoSides />;
    case Tool.FORMULA_POLYGON:
      return <PolygonFormula />;
    default:
  }
  return null;
};

export default ToolIcon;
